import React from "react";

import Navbar from "../../components/navbar";
import SocialLinks from "../../components/socialLinks";
import Body from "../../components/body";

import { Grid, Typography } from "@material-ui/core/";

import withStyles from "./styles";

class Portfolio extends React.Component {
  renderSocialLinks = () => {
    const { classes } = this.props;
    return (
      <div className={classes.socialLinkContainer}>
        <SocialLinks />
      </div>
    );
  };

  render() {
    const { classes } = this.props;
    return (
      <div>
        <Navbar />
        <Body>
          {this.renderSocialLinks()}
          <Grid
            container
            direction="column"
            justify="center"
            alignContent="center"
          >
            <div className={classes.container}>
              <Grid container>
                <Grid item xs={6} className={classes.paraContainer}>
                  <Typography
                    variant="h5"
                    inline={true}
                    className={classes.number}
                  >
                    03.
                  </Typography>
                  <Typography
                    variant="h4"
                    inline={true}
                    className={classes.pageTitle}
                  >
                    Portfolio
                  </Typography>
                </Grid>
                <Grid container className={classes.workContainer}>
                  <Grid item xs={6}>
                    <img
                      src={"/static/torchlite.png"}
                      className={classes.img}
                    />
                  </Grid>
                  <Grid item xs={6}>
                    <Grid container className={classes.oddsContainer}>
                      <Grid item xs={12}>
                        <Typography variant="h5">
                          <a
                            href="https://www.torchlite.com"
                            target="_blank"
                            className={classes.link}
                          >
                            Torchlite
                          </a>
                        </Typography>
                      </Grid>
                      <p className={classes.para}>stuff stuff</p>
                    </Grid>
                  </Grid>
                </Grid>
                <Grid container className={classes.workContainer}>
                  <Grid item xs={6}>
                    <Typography variant="h5">
                      <a
                        href="https://www.ovazi.tips"
                        target="_blank"
                        className={classes.link}
                      >
                        Ovazi
                      </a>
                    </Typography>
                  </Grid>
                  <Grid item xs={6}>
                    <img src={"/static/ovazi.png"} className={classes.img} />
                  </Grid>
                </Grid>
              </Grid>
            </div>
          </Grid>
        </Body>
      </div>
    );
  }
}

export default withStyles(Portfolio);
